e, 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': 'Currently, our logic for generating different content type requests in an operation is very convoluted and the output isn't the easiest for users to use.

The logic for this content type code was very convoluted because we were actively undoing what m4 gave us, then rebuilding our own mapping. Now that @timotheeguerin has greatly improved what m4 is giving us, we should take this opportunity to clean up this code a lot.

Additionally, to become closer to what m4 is giving us (basically an overload for each individual m4 request), and to make our outputted operation easier for end users, we should create overloads for each different content type request.

For example, what we used to generate as 
```python
def analyze_body(self, input: Optional[Union[IO, JSONType]], *, content_type: Optional[str] = "application/json"):
  ...
  if content_type.split(";")[0] in ["application/json"]:
      if input is not None:
          _json = input
  elif content_type.split(";")[0] in ["application/pdf", "image/jpeg", "image/png", "image/tiff"]:
      _content = input
  else:
      raise ValueError(
          "The content_type '{}' is not one of the allowed values: "
          "['application/pdf', 'image/jpeg', 'image/png', 'image/tiff', 'application/json']".format(content_type)
      )
  ...
```

We should now generate as
```python
@overload
def analyze_body(self, input: JSONType, *, content_type: Optional[str] = "application/json"):
  ...
@overload
def analyze_body(self, input: IO, *, content_type: Optional[str] = "application/octet-stream"):
  ...
def analyze_body(self, input: Optional[Union[IO, JSONType]], *, content_type: Optional[str] = None):
  ...
  if isinstance(input, IO):
    # we should think of a better way to determine if something is an IO input
    content_type = content_type or "application/octet-stream"
    _content = input
  else:
    content_type = content_type or "application/json"
    _json = input
  ...
```', 'reactions': {'url': 'https://api.github.com/repos/Azure/autorest.python/issues/1212/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/Azure/autorest.python/issues/1212/timeline', 'performed_via_github_app': None}}

